import { InanoSQLQuery, InanoSQLInstance } from "./interfaces";
/**
 * Query Order:
 * 0. Process, Prepare then Execute
 * 1. Where / Index Select (possibly do indexed orderby)
 * 2. Union, Join & Graph
 * 3. Group By, Functions & Distinct
 * 4. Apply AS
 * 5. OrderBy (if not done by index/pk)
 * 6. Having
 * 7. Offset & Limit
 */
export declare const executeQuery: (nSQL: InanoSQLInstance, query: InanoSQLQuery, progress: (row: any, i: number) => void, complete: (err?: string | undefined) => void) => void;
